import Navbar from "../../components/navbar/Navbar";
import Featured from "../../components/featured/Featured"
import "./home.css";

function Home() {
    return (
        <div>
            <Navbar />
            <Header />
            <div className="homeContainer">
                <Featured />       
            </div>
        </div>
    );
}

export default Home;
